    [Parameter]
    public string id { get; set; }
    ProductCategory objProductCategory = new ProductCategory();
    Privilege privi = new Privilege();
    //GetSessionInfo
    long CompanyId;
    long RoleId;
    string strMenu = "Category";
    bool strAdd = true;
    bool strEdit = true;
    bool strDelete = true;
    bool strShow = true;
    protected async override void OnInitialized()
    {
        CompanyId = await sessionStorage.GetItemAsync<long>("CompanyId");
        RoleId = await sessionStorage.GetItemAsync<long>("RoleId");
        //CheckPriviliage
        privi = priviliageRepository.PriviliageCheck(strMenu, RoleId, CompanyId);
        if (privi != null)
        {
            strAdd = privi.AddAction;
            strEdit = privi.EditAction;
            strDelete = privi.DeleteAction;
            strShow = privi.ShowAction;
            if (strShow == false)
            {
                Snackbar.Add("You dont have to privilege.", Severity.Error);
                //Toaster.Add("You dont have to privilege.", MatToastType.Success, "dashboard", null);
                navManager.NavigateTo("dashboard");
            }
        }
        else
        {
            strAdd = true;
            strEdit = true;
            strDelete = true;
            strShow = true;
        }
        objProductCategory = salesservices.EditProductCategory(Convert.ToInt64(id));
        StateHasChanged();
    }
    public async Task HandleValidSubmit()
    {
        if (strEdit == true)
        {
            var isCheck = salesservices.CheckProductCategoryId(objProductCategory.CategoryName);
            if (isCheck == objProductCategory.ProcategoryId || isCheck == 0)
            {
                objProductCategory.CompanyId = CompanyId;
                objProductCategory.ModifyDate = DateTime.Now;
                salesservices.UpdateProductCategory(objProductCategory);
                Snackbar.Add("Saved Successfully.", Severity.Success);
                navManager.NavigateTo("productcategorylist");
            }
            else
            {
                Snackbar.Add("Already Exists.", Severity.Info);
                navManager.NavigateTo("productcategoryedit");
            }
        }
        else
        {
            Snackbar.Add("You dont have to privilege.", Severity.Error);
            navManager.NavigateTo("dashboard");
        }
    }
    void Cancel()
    {
        navManager.NavigateTo("productcategorylist");
    }

